Timsher (Timshor) is a river in Perm Krai, Russia, a right tributary of the South Keltma River. It is 235 kilometres (146 mi) long, with drainage basin of 2,650 square kilometres (1,020 sq mi). It starts in the northwestern part of Perm Krai, in Gaynsky District, near the border with the Komi Republic. It flows into the South Keltma 15 kilometres (9 mi) from the larger river's mouth. There are many swamps and lakes along the river. Main tributaries: 
*  Left: Okos, Chepets; 
*  Right: Myi, Bortom.
